import { Link } from 'react-router-dom';
import './homePage.scss'

const homePage = () =>{
    return(
        <div className='body-container'>
            <div className='menu-container'>
                <div className="menuItemRow"><span className="menuItem">Inventory</span><span className="menuItem">Marketplace</span><link className="menuItem" to="/user">Account</link></div>
                <Link className="things-titleHome" to="/home">Things</Link>
            </div>
        </div>
    )
}

export default homePage
